import React, { Component } from 'react';
import Sandridge from '../images/sandridge.png';
import Victim from '../images/victimadviceline.png';

class Portfolio extends Component {

  render() {
    return (
      <div className="portfolio-container">
          <div className="unfocused portfolio-box"><a href="https://victimadviceline.org.uk/"><img src={Victim}></img></a></div>
          <div className="unfocused portfolio-box"><a href="https://vsandridge.formationmedia.site/"><img src={Sandridge}></img></a></div>
          <div className="unfocused portfolio-box"><h2>Site 3</h2></div>
          <div className="unfocused portfolio-box"><h2>Site 4</h2></div>
      </div>
    );
  }
}

export default Portfolio;
